/**
 * An example with the built-in HTTP server.
 */
const { RWServer, RWHttpServer } = require('../../index.js');

// start internal HTTP server
const httpOpts = {
  port: 3211,
  timeout: 0 // if 0 the socket connection will never timeout
};
const rwsHttpServer = new RWHttpServer(httpOpts);
const httpServer = rwsHttpServer.start(); // nodeJS HTTP server instance
setTimeout(() => {
  // rwsHttpServer.restart();
  // rwsHttpServer.stop();
}, 3400);



const wsOpts = {
  timeout: 5 * 60 * 1000,
  maxConns: 5,
  maxIPConns: 3,
  storage: 'memory',
  subprotocol: 'raw',
  tightening: 100,
  autodelayFactor: 500,
  version: 13,
  debug: true
};
const rws = new RWServer(wsOpts);
rws.socketStorage.init(null);
rws.bootup(httpServer);


// test small mesage (msglen < 126)
const msg_1 = 'A';

// test medium message (msglen >= 126 && msglen <= 0xFFFF) 0xFFFF is 65535
const msg_126 = 'OKwbx7LXO3LxUpF3Th3K0tqUkMJhFYvjfrPoye1hdI48inVqd7VJPNCBaU1KBJa68atjTKbXER7ekhE4Dh8q49D13YpctmplwwaNqosV4e8Np05klljGUZiD5qDLpF';

// test large message (msglen > 0xFFFF && msglen <= 0xFFFFFFFFFFFFFFFF) 0xFFFFFFFFFFFFFFFF is ~18*10^18
const msg_65536 = '';



/*** socket stream ***/
rws.on('connection', async socket => {
  /* send message back to the connected client */
  // await socket.extension.sendSelf(msg_1); // test short message
  // await socket.extension.sendSelf(msg_126); // test medium message
  // await socket.extension.sendSelf(msg_65536); // test large message

  /* other ways to send message back to the connected client */
  // await rws.dataTransfer.sendOne(msg_1, socket);
  // await rws.dataTransfer.carryOut(msg_1, socket);


  /* authenticate the socket */
  const authkey = 'TRTmrt'; // can be fetched from the database, usually 'users' table
  socket.extension.authenticate(authkey); // authenticate the socket: compare authkey with the sent authkey in the client request URL ws://localhost:3211/something?authkey=TRTmrt
});





/*** all messages stream ***/
rws.on('message', msg => {
  // console.log('\nmessageStream::', msg);
});
